import React from 'react'
import {View, Text, StyleSheet} from 'react-native'
export default function Card(props){
    return(
        <View style={styles.card}>
            <Text style={styles.text}>
                {props.itemHeading}
            </Text>
        </View>
    )
}
const styles = StyleSheet.create({
    card: {
        width: '40vw',
        height: '15vh',
        backgroundColor: '#fff',
        borderRadius: '2vw'
    }
})
